/*                                           SHARED                                           */
/* ------------------------------------------------------------------------------------------ */

/* ------------------------------------------------------------------------------------------ */
/*                                          COMPONENT                                         */
/* ------------------------------------------------------------------------------------------ */
$('._responsive .menu-item-has-children > a').click(function(e) {
	e.preventDefault();
	var el = $(this);
	// console.log(el);
	var parentEl = el.parent();
	parentEl.find('.menu-item-has-children').removeClass('open');
	parentEl.siblings().removeClass('open');
	parentEl.siblings().find('.menu-item-has-children').removeClass('open');
	parentEl.toggleClass('open');
})

$('.show_add_item').click(function(e) {
	console.log('ffff')
	e.preventDefault();
	$('.content_add_item').toggleClass('show');
})

$('.has-child > a').click(function(e) {
	console.log('ffff')
	e.preventDefault();
	let parentEl = $(this).parent();
	parentEl.toggleClass('active');
	//parentEl.siblings().removeClass('active');
})

/* ------------------------------------------------------------------------------------------ */
/*                                   MAIN MENU:  HORIZONTAL                                   */
/* ------------------------------------------------------------------------------------------ */

/* -----------------------------------       LEVELS       ----------------------------------- */
function mainMenuHorizontalLevels() {
	let ul = jQuery('[data-menu="horizontal"] > ul')
	while ((ul = ul.children('li:not(._mega)').children('ul')).length > 0) {
		ul.addClass('level_n')
	}
}


/* -----------------------------------       PARENTS      ----------------------------------- */
function mainMenuHorizontalParent() {
	const li = jQuery('[data-menu="horizontal"] li')
	li.each(function() {
		if (jQuery(this).children('ul').length) {
			jQuery(this).addClass('_parent')
		}
	})
}


/* -----------------------------------    MEGA WRAPPER    ----------------------------------- */
function mainMenuHorizontalMegaWrapper() {
	let ul
	jQuery('[data-menu="horizontal"] ._mega').each(function() {
		ul = jQuery(this).children('ul')
		jQuery('<div/>', { class: '_megaWrapper' }).appendTo(jQuery(this))
		ul.appendTo(jQuery(this).children('._megaWrapper'))
	})
}


/* -----------------------------------        HOVER       ----------------------------------- */
function mainMenuHorizontalHover() {

	const basic = jQuery('[data-menu="horizontal"] ._basic._parent, [data-menu="horizontal"] ._basic ._parent')
	const mega = jQuery('[data-menu="horizontal"] ._mega')

	if (window.matchMedia('(min-width: 785px)').matches) {
		basic.mouseenter(function() {
			// jQuery(this).children('ul').stop(true).slideDown(300)
			jQuery(this).children('ul').addClass('animate__animated animate__fadeInUp')
		})
		basic.mouseleave(function() {
			// jQuery(this).children('ul').slideUp(150)
			jQuery(this).children('ul').removeClass('animate__animated animate__fadeInUp')
		})
		mega.mouseenter(function() {
			// jQuery(this).children('._megaWrapper').stop(true).slideDown(300)
			jQuery(this).children('._megaWrapper').addClass('animate__animated animate__fadeInUp')
		})
		mega.mouseleave(function() {
			// jQuery(this).children('._megaWrapper').slideUp(150)
			jQuery(this).children('._megaWrapper').removeClass('animate__animated animate__fadeInUp')
		})
	} else {
		basic.unbind('mouseenter mouseleave')
		mega.unbind('mouseenter mouseleave')
	}

}

/* ------------------------------------------------------------------------------------------ */
/*                                    MAIN MENU:  VERTICAL                                    */
/* ------------------------------------------------------------------------------------------ */

/* -----------------------------------       LEVELS       ----------------------------------- */
function mainMenuVerticalLevels() {
	let ul = jQuery('[data-menu="vertical"] > ul')
	while ((ul = ul.children('li:not(._mega)').children('ul')).length > 0) {
		ul.addClass('level_n')
	}
}


/* -----------------------------------       PARENTS      ----------------------------------- */
function mainMenuVerticalParent() {
	const li = jQuery('[data-menu="vertical"] li')
	li.each(function() {
		if (jQuery(this).children('ul').length) {
			jQuery(this).addClass('_parent')
		}
	})
}


/* -----------------------------------        MEGA        ----------------------------------- */
function mainMenuVerticalMega() {
	const li = jQuery('[data-menu="vertical"] ._mega > ul > li')
	li.each(function() {
		if (!jQuery(this).hasClass('_parent')) {
			jQuery(this).remove()
		}
	})
}


/* -----------------------------------      ACCORDION     ----------------------------------- */
function mainMenuVerticalAccordion() {

	jQuery('[data-menu="vertical"] ._mega._parent').each(function() {
		let link = jQuery(this).children('a')
		link.attr('href', 'javascript:void(0)')
	})

	jQuery('[data-menu="vertical"] ._mega._parent > ul > ._parent').each(function() {
		let link = jQuery(this).children('a')
		link.attr('href', 'javascript:void(0)')
	})

	jQuery('[data-menu="vertical"] ._parent > a').click(function() {
		var $this = jQuery(this)
		if ($this.parent().hasClass('_open')) {
			$this.parent().removeClass('_open')
			$this.next().slideUp()
		} else {
			$this.parent().parent().find('._parent').removeClass('_open')
			$this.parent().parent().find('._parent > ul').slideUp()
			$this.parent().toggleClass('_open')
			$this.next().slideDown()
		}
	})

}

/* ------------------------------------------------------------------------------------------ */
/*                                           LAYOUT                                           */
/* ------------------------------------------------------------------------------------------ */

/* ------------------------------------------------------------------------------------------ */
/*                                            PAGE                                            */
/* ------------------------------------------------------------------------------------------ */

/* ------------------------------------------------------------------------------------------ */
/*                                   EVENT:  DOCUMENT READY                                   */
/* ------------------------------------------------------------------------------------------ */
jQuery(document).ready(function() {

	mainMenuHorizontalLevels()
	mainMenuHorizontalParent()
	mainMenuHorizontalMegaWrapper()
	mainMenuHorizontalHover()

	mainMenuVerticalLevels()
	mainMenuVerticalParent()
	mainMenuVerticalMega()

}) // END DOCUMENT.READY()


/* ------------------------------------------------------------------------------------------ */
/*                                   EVENT: DOCUMENT SCROLL                                   */
/* ------------------------------------------------------------------------------------------ */
jQuery(document).scroll(function() {


}) // END DOCUMENT.SCROLL()


/* ------------------------------------------------------------------------------------------ */
/*                                    EVENT: WINDOW RESIZE                                    */
/* ------------------------------------------------------------------------------------------ */
jQuery(window).resize(function() {

	WINDOW_WIDTH = parstFloatRound(jQuery(window).width())

	mainMenuHorizontalHover()

}) // END WINDOW.RESIZE()


/* ------------------------------------------------------------------------------------------ */
/*                                     EVENT: WINDOW LOAD                                     */
/* ------------------------------------------------------------------------------------------ */
jQuery(window).on('load', function() {

	jQuery('body').removeClass('_load_before')
	jQuery('body').addClass('_load')

	mainMenuVerticalAccordion()

}) // END WINDOW.ONLOAD()


